import React from "react";
import Navbar from "../components/Navbar";

const Home = () => {
  return (
    <>
      <Navbar />
      <div style={{ textAlign: "center", marginTop: "50px" }}>
        <h1>Welcome to UrbanWorkers</h1>
        <p>Find trusted workers for your daily tasks</p>
      </div>
    </>
  );
};

export default Home;
